kking, giet en spoel ze af onder koud water. In dezelfde pan als waarin je de noedels gekookt hebt, kun je de paksoi kort koken totdat deze een mooie groene kleur krijgt. Dit duurt ca. 4 minuten, haal daarna de paksoi direct uit de pan. Pel de eieren en snijd ze doormidden.\n\nramen_04.jpgramen_05.jpgramen_06.jpg\n\n Om de ramen samen te stellen verdeel je de bouillon over 4 soepkoppen. Verdeel daarna de noedels over de koppen, de paddenstoelenmix, de paksoi en de eieren. Maak af met de groene delen van de bosui en sesamzaadjes.\n\nJapanse ramen soep\n\n Maak de paksoi schoon, was hem goed onder de kraan en snijd deze over de lengte doormidden. Kook de eieren in 8 minuten gaar en spoel ze direct af onder koud water. Kook de ramen noedels volgens de verpakking, giet en spoel ze af onder koud water. In dezelfde pan als waarin je de noedels gekookt hebt, kun je de paksoi kort koken totdat deze een mooie groene kleur krijgt. Dit duurt ca. 4 minuten, haal daarna de paksoi direct uit de pan. Pel de eieren en snijd ze doormidden.\n\nOm de ramen samen te stellen verdeel je de bouillon over 4 soepkoppen. Verdeel daarna de noedels over de koppen, de paddenstoelenmix, de paksoi en de eieren. Maak af met de groene delen van de bosui en sesamzaadjes.','Japanse ramen soep',47);
